CREATE DATABASE IF NOT EXISTS `MousinhoDaSilveira`;

USE MousinhoDaSilveira;

CREATE TABLE MS_Table (
    IDAluno INT PRIMARY KEY,
    NomeDaEscola VARCHAR(255),
    DataPagamento DATE,
    ValorRecebido INT,
    MetodoPagamento VARCHAR(50),
    AtrasoPagamento VARCHAR(3),
    NumeroCartaoCredito VARCHAR(16),
    NumeroTransacao VARCHAR(8),
    NomeBanco VARCHAR(255),
    TipoPagamento VARCHAR(3),
    DiaSemana VARCHAR(15),
    NumeroCheque VARCHAR(4)
);

